import { react } from 'react-router-dom';
import React, { Component } from 'react';
import PropTypes from 'prop-types';
import { Outlet} from 'react-router-dom';
import Services from '../main-site/Services';
import AdminHome from '../dashboard/Home';
class DynamicSection extends Component {
    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <div className="col-lg-10 col-md-10 col-sm-9 col-lg-push-2 col-md-push-2 col-sm-push-3">
						<div className="row mrg-0 mrg-top-20">
							<div className="tr-single-box">
								<div className="tr-single-header">
									<h3 className="dashboard-title">Manage Hotels</h3>
								</div>
								<div className="tr-single-body">
									<AdminHome />		
								</div>
							</div>
						</div>
				</div>

            </div>
        );
    }
}

export default DynamicSection;
